import React from 'react';
import { lightGray, darkGray, primaryOrange, white } from './colors';

function Table() {
    const rows = [
        { nature: "Suspension Crédit Co-Finance", count: "" },
        { nature: "Crédit(s) Amortissable(s)", count: "" },
        { nature: "CPI(s)/CVT(s)", count: "" },
        { nature: "Compte(s) Secondaire(s)", count: "" },
        { nature: "ASM(s)", count: "" },
        { nature: "Escompte(s)", count: "" },
    ];

    return (
        <div style={{ padding: '0 20px' }}>
            <table style={{
                width: '100%',
                borderCollapse: 'collapse',
                marginTop: '20px',
                backgroundColor: white,
                boxShadow: '0 2px 5px rgba(0,0,0,0.1)'
            }}>
                <thead>
                    <tr>
                        <th style={{ backgroundColor: primaryOrange, color: white, textAlign: 'left', padding: '12px' }}>Nature</th>
                        <th style={{ backgroundColor: primaryOrange, color: white, textAlign: 'left', padding: '12px' }}>Nombre de Contrat/Compte ou Ligne</th>
                    </tr>
                </thead>
                <tbody>
                    {rows.map((row, index) => (
                        <tr key={index} style={{ borderBottom: '1px solid #ddd' }}>
                            <td style={{ padding: '12px', color: darkGray }}>{row.nature}</td>
                            <td style={{ padding: '12px', color: darkGray }}>{row.count}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default Table;
